import React from 'react';


function Trendy() {
    return (
        <div>
            <h1>Your style type is Trendy. </h1>
            <img alt="" src="https://www.proprofs.com/api/ckeditor_images/New%20Project%20(12)(54).jpg" />
            <h3 className='resultDescr'>Your wardrobe is always on trend to reflect your trendy style!</h3>
        </div>
    );
};



export default Trendy;
